 -->\n<link href="https://cdn.boxicons.com/{{VERSION}}/fonts/filled/boxicons-filled.min.css" rel="stylesheet">\n<!-- Brand Icons -->\n<link href="https://cdn.boxicons.com/{{VERSION}}/fonts/brands/boxicons-brands.min.css" rel="stylesheet">\n```\nAll font files are hosted on a fast and reliable CDN for easy global delivery.\n\n### For Pro Users\n\nIf you are a Boxicons Pro user, you can generate a custom CDN link from the **Usage** page. There, you can select exactly which **pack, style, and weight** you want to include in your project.\n\n\n<Bleed className=" overflow-hidden " full>\n<Image src="/pro-fonts.gif" className=\'figma-side rounded-4xl\' alt="Usage page screenshot" width={2000} height={1400} unoptimized />\n</Bleed>\n\nThe **Usage** link can be found in the icon mini-viewer and in the avatar dropdown menu.\n\n## Using Icons in HTML\n\nTo render an icon, add an `i` tag with the icons class name.\n\n- `bx-` prefix is used for all icons\n\n<Callout type="info" title="Icon Naming Convention">\n<p>When using multiple fonts please make sure the basic pack link tag is on top , followed by the rest</p>\n</Callout>\n\nExample:\n\n```html\n<!--  <i class="BX_CLASS BX-ICON_NAME"> -->\n<i class="bx bx-volleyball"></i>\n<i class="bxf bx-volleyball"></i>\n<i class="bxl bx-twitter"></i>\n```\n<div className="icon-display">\n<i className="bxdocs bx-volleyball"></i>\n<i className="bxdocs bxf-volleyball"></i>\n<i className="bxdocs bx-twitter"></i>\n</div>\n\n### Class Names\n\n| Pack   | Style |  Class |\n| :----- | :----: | ----: |\n| basic    |  regular   |    bx |\n| basic | rounded  |   bxr |  \n| basic | sharp  |  bxs |  \n| filled    |  regular   |    bxf |\n| filled | rounded  |   bxrf |  \n| filled | sharp  |  bxsf |  \n| duotone    |  regular   |    bxd |\n| duotone | rounded  |   bxrd |  \n| duotone | sharp  |  bxsd |  \n| duotone-solid    |  regular   |    bxds |\n| duotone-solid | rounded  |   bxrds |  \n| duotone-solid | sharp  |  bxsds |  \n| duotone-mix    |  regular   |    bxdm |\n| duotone-mix | rounded  |   bxrdm |  \n| duotone-mix | sharp  |  bxsdm |  \n| brands   |  regular   |    bxl |\n\n### Starter Template\nHeres a minimal HTML template to get you started:\n\n```html filename="starter.html" copy\n<!doctype html>\n<html lang=\'en\'>\n<head>\n<meta charset=\'utf-8\'>\n<meta name=\'viewport\' content=\'width=device-width, initial-scale=1, shrink-to-fit=no\'>\n<!-- Boxicons CSS -->\n<link href=\'https://cdn.boxicons.com/{{VERSION}}/fonts/basic/boxicons.min.css\' rel=\'stylesheet\'>\n<link href=\'https://cdn.boxicons.com/{{VERSION}}/fonts/filled/boxicons-filled.min.css\' rel=\'stylesheet\'>\n<link href=\'https://cdn.boxicons.com/{{VERSION}}/fonts/brands/boxicons-brands.min.css\' rel=\'stylesheet\'>\n \n<title>Hello, Boxicons!</title>\n</head>\n<body>\n<h1>Hello, Boxicons!</h1>\n<i class=\'bx bx-hot\'></i>\n<i class=\'bxf bx-fire\'></i>\n<i class=\'bxl bx-twitter-x\'></i>\n</body>\n</html>\n```\n\nYou can also access the SVG\'s from our CDN at:\n\n```html copy\nhttps://cdn.boxicons.com/{{VERSION}}/svg/<PACK_NAME>/<ICON_NAME_WITH_PREFIX_BX>.svg\n\n<img src="https://cdn.boxicons.com/{{VERSION}}/svg/basic/bx-8-ball.svg" alt="8-ball"/>\n<img src="https://cdn.boxicons.com/{{VERSION}}/svg/filled/bx-8-ball.svg" alt="8-ball"/>\n<img src="https://cdn.boxicons.com/{{VERSION}}/svg/brands/bx-facebook.svg" alt="facebook"/>\n```',"toc",0,g])},6026,a=>{"use strict";var b=a.i(7997),c=a.i(41113),d=a.i(57742),e=a.i(84347),f=a.i(95936);let g=Object.assign(({children:a,num:c=3,className:d,style:f,...g})=>(0,b.jsx)("div",{className:(0,e.default)("nextra-cards x:mt-4 x:gap-4 x:grid","not-prose",d),...g,style:{...f,"--rows":c},children:a}),{displayName:"Cards",Card:a=>{let c,g,h,i,j,k,l,m,n,o,p,q,r,s=(0,d.c)(29);s[0]!==a?({children:g,title:l,icon:j,arrow:c,href:i,className:h,...k}=a,s[0]=a,s[1]=c,s[2]=g,s[3]=h,s[4]=i,s[5]=j,s[6]=k,s[7]=l):(c=s[1],g=s[2],h=s[3],i=s[4],j=s[5],k=s[6],l=s[7]);let t=g?"x:bg-gray-100 x:shadow x:dark:border-neutra